B.Lv=new A.b9("The \u201cEMOTIONS DETECTION THROUGH TEXT\u201d system is a web-based application. The main purpose of our project is to provide a convenient way for a user to detect a opposite person\u2019s emotions through the text. In this project I have created a simple chat application in python for communication purpose and we used that data to detect the person\u2019s emotion using NLP, in 10 different categories anger, disgust, fear, happy, joy, neutral, sad, sadness, shame, surprise.Detecting emotional state of a person by analysing a text written by him/her appear challenging but also essential many times due to the fact that most of the times textual expressions are not only direct using emotion words but also result from the interpretation of the meaning of concepts and interaction of concepts which are described in the text. Recognizing the emotion of the text plays a key role in the human-computer interaction. Emotions may be expressed by a person\u2019s speech, face expression and written text known as speech, facial and text-based emotion respectively. Sufficient amount of work has been done regarding to speech and facial emotion recognition but text-based emotion recognition system still needs attraction of researchers. In computational linguistics, the detection of human emotions in text is becoming increasingly important from an applicative point of view. ",null,B.bu,null,null,null)
